import React from 'react';
import { Modal, Box, Typography, IconButton } from '@mui/material';
import CloseIcon from '@mui/icons-material/Close';

const SignUpModal = ({ open, handleClose }) => {
  return (
    <Modal
      open={open}
      onClose={handleClose}
      aria-labelledby="sign-up-modal-title"
      aria-describedby="sign-up-modal-description"
    >
      <Box sx={{
        position: 'absolute',
        top: '50%',
        left: '50%',
        transform: 'translate(-50%, -50%)',
        width: 400,
        bgcolor: 'background.paper',
        border: '2px solid #000',
        boxShadow: 24,
        p: 4,
      }}>
        <IconButton
          aria-label="close"
          onClick={handleClose}
          sx={{
            position: 'absolute',
            right: 8,
            top: 8,
            color: (theme) => theme.palette.grey[500],
          }}
        >
          <CloseIcon />
        </IconButton>
        <Typography id="sign-up-modal-title" variant="h6" component="h2">
          Sign Up
        </Typography>
        <Typography id="sign-up-modal-description" sx={{ mt: 2 }}>
          {/* Replace this with your actual sign-up form */}
          <iframe
            src="https://northernlionlabs.myfreshworks.com/crm/sales/web_forms/878096a47237ef12a6f963047c297e7e09645dcba8490d9b0e631e7eab0e9385/form.html"
            width="100%"
            height="400px"
            frameBorder="0"
          ></iframe>
        </Typography>
      </Box>
    </Modal>
  );
};

export default SignUpModal;
